import React from 'react';
import Card from './Card';
import MarketContext from '../utils/MarketContext';


const MarketOverview = () => {
    return (
        <MarketContext.Provider>
        <div>
            <div className="row">
                <div className="col-sm-4">
                    <Card />
                </div>
                <div className="col-sm-4">
                    <Card />
                </div>
                <div className="col-sm-4">
                    <Card />
                </div>
            </div>
        </div>
        </MarketContext.Provider>

    );
};

export default MarketOverview;
